import { useRef } from 'react'
import UseAnimScrollVideo from '../../CustomHoocks/video/UseAnimScrollVideo'
import scrollAnimVideo from '../../fonction/video/ScrollAnimVideo'
import TitreVideo from './TitreVideo'
import ContenuVideo from './ContenuVideo'
import ImgVideo from './ImgVideo'

export default function PartieVideo() {

    const titreContainerQuatre = useRef("");const containerTitrePageQuatre = useRef("");const containerContenuTitrePageQuatre = useRef("");
    const containerContenuTextePageQuatre = useRef("");const containerImg = useRef("");

    UseAnimScrollVideo(()=>scrollAnimVideo(containerTitrePageQuatre,titreContainerQuatre,containerContenuTitrePageQuatre,containerContenuTextePageQuatre,containerImg));
    

  return (
    <div  className="supp1024:h-[1800px] supp1600:h-[2200px] fontAbril bg-belge w-full h-[1610px] pt-[200px] ">
        <TitreVideo ref={titreContainerQuatre} />
        <div className="supp1024:h-[1190px] supp1600:h-[1490px] supp768:w-[720px]  h-[1000px] w-[90%] border-[4px] border-bleuGris my-0 mx-auto rounded-[30px] ">
            <ContenuVideo refUne={containerTitrePageQuatre} refDeux={containerContenuTitrePageQuatre} refTrois={containerContenuTextePageQuatre} />
            <ImgVideo ref={containerImg} />
        </div>
    </div>
  )
}
